}*/

const Navbar = () => {
  return (
    <Router>
      <nav>
        <div class="nav-bar" id="nav-bar">
          <a href="#Home" class="initial-page">
            P√ÅGINA INCIAL
          </a>

          <a href="login.html">ENTRAR</a>
